// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

/**
 * @title IEscrowErrors
 * @notice Interface defining all custom errors used by the Escrow contract
 * @dev Custom errors provide more gas-efficient error handling compared to require strings
 */
interface IEscrowErrors {
    /**
     * @notice Thrown when attempting to perform an action on a challenge that has already been closed
     * @dev A challenge is considered closed once its deadline has passed
     */
    error ChallengeAlreadyClosed();

    /**
     * @notice Thrown when a user attempts to submit to a challenge they have already submitted to
     * @dev Each address can only submit once per challenge to prevent spam
     */
    error AlreadySubmitted();

    /**
     * @notice Thrown when attempting to resolve a challenge before its deadline
     * @dev Challenges can only be resolved after their deadline has passed to ensure fair submission periods
     */
    error ChallengeNotClosed();

    /**
     * @notice Thrown when attempting an action that requires a challenge to be in pending state
     * @dev Currently defined but not actively used in the current implementation
     */
    error ChallengeNotPending();

    /**
     * @notice Thrown when attempting an action that requires a challenge to be in validating state
     * @dev Currently defined but not actively used in the current implementation
     */
    error ChallengeNotValidating();

    /**
     * @notice Thrown when attempting an action that requires a challenge to be refunded
     * @dev Currently defined but not actively used in the current implementation
     */
    error ChallengeNotRefunded();

    /**
     * @notice Thrown when a user attempts to withdraw more funds than their available balance
     * @dev Prevents users from withdrawing funds they haven't earned or already withdrawn
     */
    error InsufficientBalance();

    /**
     * @notice Thrown when a user attempts to perform an action that requires them to be the admin of the challenge
     * @dev Prevents users from performing actions that require them to be the admin of the challenge
     */
    error OnlyAdmin();

    /**
     * @notice Thrown when a user attempts to get a submission id that doesn't exist
     * @dev Prevents users from getting a submission id that doesn't exist
     */
    error SubmissionNotFound();

    /**
     * @notice Thrown when a user attempts to perform an action that requires a challenge to be active
     * @dev Prevents users from performing actions that require a challenge to be active
     */
    error ChallengeNotActive();

    /**
     * @notice Thrown when a user attempts to submit to a challenge they are the admin of
     * @dev Prevents users from submitting to a challenge they are the admin of
     */
    error AdminCannotSubmit();

    /**
     * @notice Thrown when a user attempts to resolve a challenge that has already been resolved
     * @dev Prevents users from resolving a challenge that has already been resolved
     */
    error ChallengeAlreadyResolved();

    /**
     * @notice Thrown when a user attempts to resolve a challenge with an invalid submission count
     * @dev Prevents users from resolving a challenge with an invalid submission count
     */
    error InvalidSubmissionCount();
}

contracts/interfaces/IEscrow.events.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

import {IEscrowStructs} from "./IEscrow.structs.sol";

/**
 * @title IEscrowEvents
 * @notice Interface defining all events emitted by the Escrow contract
 * @dev These events provide transparency and allow off-chain applications to track escrow activity
 */
interface IEscrowEvents {
    /**
     * @notice Emitted when a new challenge is created
     * @param challengeId The unique identifier of the created challenge
     * @param metadataURI URI pointing to challenge metadata (description, requirements, etc.)
     * @param poolSize The total reward pool size for this challenge
     * @param deadline The timestamp after which submissions are no longer accepted
     */
    event ChallengeCreated(uint256 challengeId, string metadataURI, uint256 poolSize, uint256 deadline);

    /**
     * @notice Emitted when a challenge is resolved and rewards are distributed
     * @param challengeId The unique identifier of the resolved challenge
     * @param awardedSubmissions Array of submission IDs that were awarded
     * @param ineligibleSubmissions Array of submission IDs that were ineligible
     */
    event ChallengeResolved(uint256 challengeId, uint256[] awardedSubmissions, uint256[] ineligibleSubmissions);

    /**
     * @notice Emitted when a user submits their work for a challenge
     * @param submissionId The unique identifier of the submission within the challenge
     * @param challengeId The challenge this submission belongs to
     * @param submitter The address of the user who made the submission
     */
    event SubmissionCreated(uint256 challengeId, uint256 submissionId, address submitter);

    /**
     * @notice Emitted when a user withdraws their earned rewards
     * @param user The address that withdrew the funds
     * @param amount The amount of tokens withdrawn
     */
    event Claimed(address user, uint256 amount);
}

contracts/interfaces/IEscrow.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import {IEscrowErrors} from "./IEscrow.errors.sol";
import {IEscrowEvents} from "./IEscrow.events.sol";
import {IEscrowStructs} from "./IEscrow.structs.sol";

// Escrow contracts for bookings

interface IEscrow is IEscrowErrors, IEscrowEvents, IEscrowStructs {
    /// @notice Owner calls this function to create a challenge
    function createChallenge(
        string calldata metadataURI,
        uint256 poolSize,
        uint256 deadline
    ) external;

    /// @notice Read challenge instance
    function getChallenge(
        uint256 challengeId
    ) external view returns (Challenge memory);

    /// @notice Get the number of challenges
    function getChallengesCount() external view returns (uint256);

    /// @notice Get the challenges for which the user is the admin
    function getAdminChallenges(
        address admin
    ) external view returns (uint256[] memory);

    /// @notice User calls this function to create a submission
    function createSubmission(
        uint256 challengeId,
        string calldata contact,
        string calldata submissionURI
    ) external;

    /// @notice Read submission instance
    function getSubmission(
        uint256 challengeId,
        uint256 submissionId
    ) external view returns (Submission memory);

    /// @notice Get the number of submissions for a challenge
    function getSubmissionsCount(
        uint256 challengeId
    ) external view returns (uint256);

    /// @notice Get the submission id for a user
    function getUserSubmissions(address user) external view returns (UserSubmission[] memory);

    /// @notice Owner calls this function to resolve a challenge
    function resolveChallenge(
        uint256 challengeId,
        uint256[] calldata awardedSubmissions,
        uint256[] calldata ineligibleSubmissions
    ) external;

    /// @notice Read the balance of an account
    function getClaimable(
        uint256 challengeId,
        address account
    ) external view returns (uint256);

    /// @notice User calls to withdraw funds from the escrow
    function claim(uint256 challengeId) external;
}

contracts/interfaces/IEscrow.structs.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title IEscrowStructs
 * @notice Interface defining all data structures used by the Escrow contract
 * @dev These structs organize challenge and submission data in a standardized format
 */
interface IEscrowStructs {
    enum ChallengeStatus {
        Active,
        PendingReview,
        Completed
    }

    /**
     * @notice Challenge data structure containing all information about a challenge
     * @param uri URI pointing to off-chain metadata (description, requirements, submission guidelines, etc.)
     * @param poolSize The total reward pool size in tokens for this challenge
     * @param endsAt Unix timestamp after which no new submissions are accepted and challenge can be resolved
     * @param createdAt Unix timestamp when the challenge was created
     */
    struct Challenge {
        string metadataUri;
        address admin;
        uint256 poolSize;
        uint256 endsAt;
        uint256 createdAt;
        ChallengeStatus status;
    }

    enum SubmissionStatus {
        Pending,
        Ineligible,
        Accepted,
        Awarded
    }

    /**
     * @notice Submission data structure containing information about a user's submission to a challenge
     * @param uri URI pointing to the actual submission content (work, deliverables, proof, etc.)
     * @param submitter The address of the user who made this submission
     * @param contact The contact information of the user who made this submission
     * @param createdAt Unix timestamp when the submission was created
     */
    struct Submission {
        string metadataUri;
        address creator;
        string creatorContact;
        SubmissionStatus status;
        uint256 createdAt;
    }

    /**
     * @notice User submission data structure containing information about a user's submission to a challenge
     * @param challengeId The id of the challenge
     * @param submissionId The id of the submission
     */
    struct UserSubmission {
        uint256 challengeId;
        uint256 submissionId;
    }
}

